%[text] # An Introduction to MATLAB
%[text] %[text:anchor:T_EE64DA8C] This exercise introduces the MATLAB desktop and Live scripts. And Fundamental data classes
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:H_242D1437] ## Exploring the MATLAB desktop
%[text] %[text:anchor:H_141A20AF] ### Ribbon Interface
%[text] %[text:anchor:H_C93ABFCA]  MATLAB has a context sensitive toolbar called the ribbon interface
%[text] ![](text:image:6708)
%[text] - We will often refer to this interface, typically by Tab
%[text] - Notice in the above image  we have the Home tab selected
%[text] - Notice each ribbon is further broken down into sections, like "FILE" or "VARIABLE" \
%%
%[text] ### Side Panel Toolbar 
%[text] In addition to the Ribbon Interface, there are also vertical toolbars running along the sides of the Desktop. Clicking on these icons bring up different panels.
%[text] ![](text:image:2678)
%[text] Notice the top 2 icons are grouped together. When you click on one of the icons, both panels are opened. 
%[text] **Try it now:**
%[text] 1. Click on the different icons in the side bar
%[text] 2. Click on the same icon twice. What happens?
%[text] 3. Click on the Open Panel Icon and Select "Copilot Chat" - This is the AI included with our license of MATLAB
%[text] 4. Drag the Copilot Chat Panel by its title bar over to the left side of the MATLAB desktop,  below the Workspace - Notice that the Copilot Chat Icon is now grouped  with the File Panels and Workspace Icons
%[text] 5. Drag the Copilot Icon down (outside of the grouped File Panel and Workspace Icons). Keep the icon on the left side \
%%
%[text] ### Move the Command Window
%[text] The default layout shows the command window at the bottom of the Desktop
%[text] ![](text:image:836d)
%[text] **Click** on the 3-Dot icon on the right side of the title bar. This brings up a menu. Select the Sub-menu "Move Command Window:Left"
%[text] ![](text:image:9da5)
%[text] The command window should now be shown in the left panel.
%[text] **Group** the Command Window with the Files Panel and Workspace by dragging the icon atop of one of those icons. The three panels will now be show together, in the order of of the icons in the toolbar
%%
%[text] ### Layouts
%[text] In the **Home** tab, in the Environment Section, there is a Layout Icon
%[text] ![](text:image:63e5)
%[text] **Try it now. Click on the Layout Icon and:**
%[text] 1. Save Current Layout as "My Layout"
%[text] 2. Select the Three Column Layout: Notice the Workspace is now on the left
%[text] 3. Select My Layout: The Layout should revert to the previous layout before you started these shenanigans  \
%%
%[text] ## Entering Commands
%[text] %[text:anchor:H_5826C878] ### Command Window
%[text] %[text:anchor:H_A54175F2] The command window is the area in MATLAB where you can type  MATLAB code and have it immediate execute. Try it now. Enter the following in the command window:
%[text] ```matlabCodeExample
%[text] a = 1
%[text] ```
%[text] - Note what is outputted to the command window after the code \
%[text] %[text:anchor:H_4C117FFB] ### Workspace
%[text] %[text:anchor:H_ED6F0B40] The workspace is a very handy window that helps you keep track of your variables in a table 
%[text] Since we just created a variable, there should be one listed in the workspace now
%[text] ![](text:image:4a5f)
%[text] - There is one row in the Workspace
%[text] - Here we see the name of the variable (a), its value, the size, number of bytes, and class
%[text] - You can add or remove columns by right-click on the a column header in the workspace, which brings up a contextual menu \
%[text] Make sure the Workspace displays the following columns:
%[text] ![](text:image:110a)
%%
%[text] %[text:anchor:H_1AA300D1] ### Variable Editor
%[text] If you double-click on a row in the workspace, the variable editor opens on the right side of the Desktop. 
%[text] %[text:anchor:H_7B9C1E78] You can edit or copy variable content as if you were using spreadsheet editor
%[text] ![](text:image:59a9)
%[text] **Try it now:** 
%[text] 1. Change the value to 2. What happens in the workspace? What happens in the command window?
%[text] 2. Add the value 3 below value 2. What is shown in the workspace
%[text] 3. Add the Letter `'a'` to row 1, column 2. What happens now? Does that make any sense? \
%[text] %[text:anchor:H_7DBE5826] ### 
%%
%[text] %[text:anchor:H_89C74B45] ### Files and the Files Panel
%[text] At launch, MATLAB opens a folder on your hard drive. This is known as the current folder.
%[text] You can see a reference to the current folder just below the ribbon strip, in the address bar:
%[text] ![](text:image:9889)
%[text] %[text:anchor:H_F7675030] - The above Address bar indicates that the current folder is in the **`unit1`** folder in the scripts folder of the `MtMtools` folder in the MATLAB drive.
%[text] - You may see something along the lines of ~/Documents/Folder which points to a location on your hard drive \
%[text] The Files Panel displays the contents of the current folder
%[text] ![](text:image:0486)
%[text] - You can change which columns are shown in this window by clicking on the 3-dot icon down triangle to bring up the contextual menu
%[text] -     OR by right clicking on one of the headers below the Title bar \
%[text] **Try it now**:
%[text] 1. Change the current folder to the MATLAB Drive by clicking on the MATLAB drive Folder Icon ![](text:image:28ec)
%[text] 2.  Change to the Documents folder on your computer by click on the Open Directory Icon ![](text:image:313f) and navigating to the Documents folder \
%[text] Notice as you navigate to other folders, the contents displayed changes.
%[text] 
%%
%[text] ## Documentation
%[text] MATLAB has excellent documentation.
%[text] %[text:anchor:H_D8B6C28D] You can bring up the MATLAB documentation in several ways. 
%[text] First, you can enter a term in the search bar (top right corner)
%[text] ![](text:image:0fdd)
%[text] Or You can click on the ![](text:image:5bc1) icon (which you can find next to the search bar or in the Home tab in the ribbon strip
%[text] Or, you can type doc in the command window
doc
%[text] Any of these commands will launch your web browser and open the documentation online
%[text] ### 
%%
%[text] %[text:anchor:H_492305C2] ### Important Settings
%[text] The following settings that can improve the performance of MATLAB for certain tasks, especially later in the semester. Lets set them now, before we forget. 
%[text] %[text:anchor:H_2B215584] #### Java Heap Size
%[text] 1. Click on the Home Tab ![](text:image:57ad)
%[text] 2. Select the Settings icon: ![](text:image:7c96)
%[text] 3. Under Java Heap Size, drag the slider all the way to the right \
%[text] ![](text:image:777f)![](text:image:9ba0)
%[text] #### Source Control
%[text] We will be using the Source Control features of  MATLAB to share course documents. Make sure Source Control is enabled on your settings, under the Source Control Tab. 
%[text] ![](text:image:7155)
%[text] 
%%
%[text] %[text:anchor:H_46646119] ## Live Scripts
%[text] This document is a MATLAB [live script](https://www.mathworks.com/help/releases/R2018a/matlab/matlab_prog/what-is-a-live-script-or-function.html). It is contained in the Editor Panel. And it is organized into sections called Code Sections. Each Section runs independently from the other Sections. You select a section by simply clicking inside that block. Once selected, the section is outlined by blue (as opposed to light gray).
%[text] **Try it now**: click on the next section titled "Code blocks".
%[text] - Notice the change in the section outline color.
%[text] - The section highlighted in blue is the currently selected section \
%%
%[text] %[text:anchor:H_686BA3EB] ### Code blocks
%[text] Code blocks contain lines of MATLAB code, such as the following in the light gray color box. 
clearvars
clc
disp('cleared') %[output:2cf7cd46]
%[text] **Try it now:** Run the code block in this section. To execute the code:
%[text] ![](text:image:8684)
%[text] - Select "Run Section" in the Live Editor tab (Note: DO NOT click on the RUN button, that will run ALL of the code blocks)
%[text] - OR Click on the left edge of this code block (the strip of blue or striped-blue on the side)
%[text] - OR Right-Click on the code block and select "Run Section" in the contextual menu
%[text] - OR enter the keyboard shortcut listed next to the menu item "Run Section" in the contextual menu \
%[text] After execution:
%[text] - what happened to *a*?
%[text] - What happened to the text in the Command Window? \
%%
%[text] %[text:anchor:H_77C0B35B] #### Try it now: Copy File Path
%[text] A File Path is a character array used to find files or folders on your computer. You can easily find the current folder file path as follows
%[text] %[text:anchor:H_F7675030] - Click on the icon of the far left side of the file address bar: you  get the file path to the folder
%[text] - ![](text:image:960b)
%[text] - Notice this path is selected and copy-able.
%[text] - TRY IT NOW. Copy the path and assign to a new character array called ***my\_path.*** Don't forget your single quotes \
''
%%
%[text] ### Function pwd
%[text] The function **`pwd`** returns the path to the current folder
%[text] Notice, you  get the same file path by entering the **pwd** command in the command window
my_path = pwd %[output:5d3d0374]
%[text] - PC users will get something that looks different from Mac users, but we both will get a character array that represents a location on our hard drives.  \
%%
%[text] %[text:anchor:H_9519DDC0] ### Output location
%[text] After you execute the above section, you should see some output below the code, just as you would in the command window.  This is called the "output."
%[text] The location of the output can either "inline", which means below the code block or it can to the right of the code block. Or the Code can be completely hidden
%[text]  This position is controlled by the icons in the vertical toolbar on the right side of the Editor Panel buttons on the top right side of the live script that look like this:
%[text] ![](text:image:28ef)
%[text] If you hover over these buttons, you will see a tooltip string that states its function: "Show outputs on right" or "Show outputs inline". 
%[text] **Try it now.** Toggle between the buttons. 
%%
%[text] ## View Tab
%[text] The view tab in the Ribbon Interface provides additional controls for the display. In the first section, "DISPLAY", you can display "Datatips" and "Line Numbers". Make sure those are selected, as follows
%[text] ![](text:image:41fb)
%[text] If you click on Full Screen, the Editor takes over your whole screen. 
%[text] %[text:anchor:TMP_0360] Try it now.
%[text] To get out of full screen, click on the following icon, found in the top right corner of the window:
%[text] ![](text:image:563a)
%[text] Notice in the View Section of the View tab, you have the Output view controls as well.
%[text] You can also open an Outline Panel, which displays an outline of the Live Script
%%
%[text] %[text:anchor:H_208670F1] ### Build you own block. 
%[text] **Try it now**. 
%[text] 1. Move the cursor to the end of this section (after "Execute the code block")
%[text] 2. Click on the Section Break icon to create a new section (or find the keyboard short-cut in the contextual menu).
%[text] 3. Click on the Text Icon ![](text:image:5de0)in the Live Editor Tab to add text
%[text] 4. Add a Heading 1 Header called "My First Code Block"
%[text] 5. Add text below this section that says "Here is my first line of code:"
%[text] 6. Below that text, add a code block by clicking on the code icon: ![](text:image:071c)
%[text] 7. Add a=3 to that code block.
%[text] 8. Execute the code block \
%[text] %[text:anchor:H_8D8B113A] ### 
%%
%[text] %[text:anchor:H_5688985B] ### Code Pause
%[text] Since we turned on Line Numbers in the View tab, each line of code in the code block should have a line number. If you click on the number, it will become highlighted in red as shown here:
%[text] ![](text:image:9e78)
%[text] %[text:anchor:H_AF2BAD3D] Once highlighted, the corresponding line of code will will also freeze code execution at that location and interfere with your coding.  
%[text] %[text:anchor:H_FED93C14] #### Try it now. 
%[text] Click on the first line number in the code block below and then try to execute the code block. 
clearvars
a = 2
b = 3
%[text] - What happens?  \
%[text] ONE: The "Debugger" panel will open:
%[text] ![](text:image:5794)
%[text] TWO: in the Live Editor Tab, the icons in the "RUN" section  become active (full color, not faded)
%[text] ![](text:image:8f0c)
%[text] Notice that are a several options you can select
%[text] - **Continue**: Just keep going
%[text] - **Step**: step through the code line by line.
%[text] - **Step in** and **out**: jump into and back out of a function
%[text] - **Stop**: stop \
%[text] **Now you try:**
%[text] 1. Click on **Step**. Notice you can step through each line of code, one at a time. What happens in the Command Window?
%[text] 2. Rerun the code block
%[text] 3. Click on **Continue**
%[text] 4. Rerun the code block
%[text] 5. Click on **Step**, then **Stop**
%[text] 6. Click on the highlight number (so it is no longer highlighted), then Re-run the code block. \
%[text] Ok, now you have debugged your first code block. If you have accidentally highlight a number in the future, simply un-highlight and then move on. Unless you want to use the debugging tools. 
%%
%[text] %[text:anchor:H_A2C81D4F] ### Comments
%[text] Sometimes you want to add a comment along with your code. The special character % indicates the start of a comment. Comments appear as green text
clearvars % clear variables
a = 1 % This is a comment, b=3 %[output:7dfa89ed]
%[text] - notice that any code in the comment is not executed \
%%
%[text] %[text:anchor:H_BD57FB7B] ### Clear all
%[text] Clear your workspace and the command window by executing following commands:
clearvars
clc 
%[text] Your variables are now gone! Don't worry, we'll make more.
%%
%[text] # Course Material
%[text] I have create a companion set of tools to accompany this  including Course Documentation, Data,  Functions, and Live Scripts 
%[text] ## Course Documentation
%[text] I have created a companion website for learning MATLAB called [Muddling Through MATLAB](https://salcedoe.github.io/MtMdocs/matlabBasics/MatlabIntro/). I will be referring to this website throughout the course. 
%[text] ## Course Tools
%[text] I have stored a compilation of companion Course Functions and Live Scripts in a github repository. If you have not done so yet, you can add these tools to your MATLAB drive using this link: [MtMtools](https://matlab.mathworks.com/open/github/v1?repo=salcedoe/MtMtools).
%[text] If you have already already added the folder, then you should see the `MtMtools` folder in your MATLAB drive.
%[text] Read more about github and adding repositories to MATLAB on the [Setup page](https://salcedoe.github.io/MtMdocs/setup/githubRepoInstallation/) of the Course Documentation. 
%[text] #### Updating the tools
%[text] If you have previously added the MtMtools folder to your  MATLAB drive, right-click on the Folder in the Files viewer, and select the "Pull" menu item from the "Source Control Submenu". This will download the latest versions of the scripts and files.
%[text] ![](text:image:413e)
%[text] #### Live Scripts
%[text] Many of the class exercises in the course are save as Live scripts, including this one. These live scripts can be found in the MtMtools/Scripts folder. Inside the Scripts folder, the scripts are organized by unit, e.g. `unit1`. 
%[text] #### Set Path 
%[text] The Course Functions can be found in the MtMtools/MtMtoolbox folder. Notice that they all start with the `mm-` prefix.
%[text] ![](text:image:2bb5) ![](text:image:09b1)
%[text] For these functions to work, MATLAB needs to find them.  MATLAB finds function by searching the Path — a compendium of folders containing  MATLAB stuff. To add the course functions to the MATLAB path, follow these steps. 
%[text] 1. Home Tab
%[text] 2. Click on Set Path (under "Environment" section)
%[text] 3. "Add Folder to Path"
%[text] 4. Select the `MtMtools/MtMtoolbox` folder
%[text] 5. Check On "Save path for future sessions" - so you don't have to repeat this process
%[text] 6. Click "OK" \
%[text] ![](text:image:74a6)
%%
%[text] ## Course Data
%[text] As we work through the course exercises, we will be loading example datasets. I have save all of these datasets in a shared MATLAB drive folder called "MtMdata".
%[text] - You can add this folder to your MATLAB drive by clicking on this [MATLAB Drive link](https://drive.mathworks.com/sharing/36f2e302-384d-4c4e-aa98-8e853c1051c0).
%[text] - Clicking on this link should take you to the online MATLAB drive Website.
%[text] - Under the "Shared Content" tab, select "Add Shortcut" to add a synchronized copy of the folder to your MATLAB drive. \
%%
%[text] ####  Did you do it right?
%[text] Try to run the following code block
mmSetUnitDataFolder(1); % set to unit 1 %[output:0a789f35]
%[text] - If you correctly added the Data folder to your MATLAB and Set the Path to the `MtMtools/MtMtoolbox` folder, then you should get some  output reporting the Current folder has been changed
%[text] - If not, you will get some red text that hopefully explains the problem \
%[text] 
